import axios from 'axios';
import React, { useState } from 'react';
import { Button, Col, Container, Form, Row } from 'react-bootstrap';
import { useNavigate } from 'react-router-dom';

const Register = () => {
  const [f_name, setFName] = useState('');
  const [l_name, setLName] = useState('');
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [password1, setPassword1] = useState('');
  const [email, setEmail] = useState('');
  const [message, setMessage] = useState('');
  const [flag, setFlag] = useState(null);
  const navigate = useNavigate();

  const changeHandler = (ev) => {
    const { name, value } = ev.target;
    if (name === 'f_name') setFName(value);
    if (name === 'l_name') setLName(value);
    if (name === 'username') setUsername(value);
    if (name === 'password') setPassword(value);
    if (name === 'password1') setPassword1(value);
    if (name === 'email') setEmail(value);
  };

  const submit = (e) => {
    e.preventDefault();
    if (password === password1) {
      if (email || username) {
        axios.post('http://localhost:3000/register', { f_name, l_name, username, password, email })
          .then((response) => {
            if (response.data.message) {
              setMessage(response.data.message);
              setFlag(1);
              setTimeout(() => {
                navigate('/login');
              }, 1500);
            } else {
              setMessage(response.data.warning);
              setFlag(2);
            }
          });
      } else {
        alert("Please fill all form");
      }
    } else {
      alert("Entered Passwords do not match\nPlease try again");
    }
  };

  let messageDisplay;
  if (flag === 1) {
    messageDisplay = <div className="alert alert-success alert-dismissible fade show" role="alert">
      <strong>{message}</strong><br />
    </div>;
  } else if (flag === 2) {
    messageDisplay = <div className="alert alert-danger alert-dismissible fade show" role="alert">
      <strong>{message}</strong><br />
      Forget Your password?<a href='#'>Click Here</a>
    </div>;
  }

  return (
    <Container>
      <Row>
        <Col>{messageDisplay}</Col>
        <Col>
          <Form>
            <Form.Group>
              <Form.Label>First Name</Form.Label>
              <Form.Control name='f_name' type="text" placeholder="First Name" onChange={changeHandler} required />
            </Form.Group>
            <Form.Group>
              <Form.Label>Last Name</Form.Label>
              <Form.Control name='l_name' type="text" placeholder="Last Name" onChange={changeHandler} required />
            </Form.Group>
            <Form.Group>
              <Form.Label>User Name</Form.Label>
              <Form.Control name='username' type="text" placeholder="User Name" onChange={changeHandler} required />
            </Form.Group>
            <Form.Group>
              <Form.Label>Email address</Form.Label>
              <Form.Control name='email' type="email" placeholder="Enter Email" onChange={changeHandler} required />
              <Form.Text className="text-muted">
                We'll never share your email with anyone else.
              </Form.Text>
            </Form.Group>
            <Form.Group>
              <Form.Label>Password</Form.Label>
              <Form.Control name='password' type="password" placeholder="Password" onChange={changeHandler} required />
            </Form.Group>
            <Form.Group>
              <Form.Label>Confirm Password</Form.Label>
              <Form.Control name='password1' type="password" onChange={changeHandler} placeholder="Password" />
            </Form.Group>
            <Button onClick={submit} variant="primary" type="submit">
              Submit
            </Button>
          </Form>
        </Col>
        <Col></Col>
      </Row>
    </Container>
  );
};

export default Register;
